import React from 'react';


const Tour = ({data}) =>{

    const [tour, setGreeting] = useState(data);

    return(
        <>
        {            
            data.map(tour => {
                console.log(tour.id);
                return(
                    <div key={tour.id}> 
                        <h3>{tour.name}</h3>
                        <img src={tour.image} alt="" />                                                                      
                    </div>
                )

            })
        }
        </>                
    )
};

export default Tour;
